import React, { Component } from 'react'
import PropTypes from 'prop-types'
import Link from 'next/link'

export default class extends Component {
  static propTypes = {
    q: PropTypes.number
  }

  constructor (props) {
    super(props);
    this.state = {
        ...this.props,
        next: this.props.q + 1
    };
  }

  componentDidMount() {}

  failure() {
      return('')
  }

  success() {
    return (
        <div>
            <div>Here goes the question number { this.state.q }, I guess?</div>
            <p>Something informative, but smol</p>
            <div>First Answer</div>
            <div>Second Answer</div>
            <div>Third Answer</div>

            <Link href='question' as={ "/question/" + this.state.next }>
            <button>Next</button>
            </Link>
        </div>
    )
  }

  render() {
      if (isNaN(this.state.q)) {
          return (this.failure())
      }
      return(this.success())
  }
}
